import React, { useState } from 'react';
import SignUpPopup from './SignUpPopup';

const Header = () => {
  const [isPopupOpen, setIsPopupOpen] = useState(false);

  const handleOpenPopup = () => setIsPopupOpen(true);
  const handleClosePopup = () => setIsPopupOpen(false);

  return (
    <header className="bg-white fixed top-0 w-full shadow-md z-50">
      <div className="container mx-auto px-6 py-4 flex justify-between items-center">
        <div>
          <img src="../assets/logo.png" alt="Replaice Logo" className="h-8" />
        </div>
        <nav className="space-x-6">
          <a href="#" className="text-gray-600 hover:text-blue-600">Product</a>
          <a href="#" className="text-gray-600 hover:text-blue-600">Agents</a>
          <a href="#" className="text-gray-600 hover:text-blue-600">Resources</a>
          <a href="#" className="text-gray-600 hover:text-blue-600">Pricing</a>
          <button
            className="text-gray-600 hover:text-blue-600"
            onClick={handleOpenPopup}
          >
            Join Us
          </button>
          <button
            className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
            onClick={handleOpenPopup}
          >
            Get Started
          </button>
        </nav>
      </div>
      {isPopupOpen && <SignUpPopup onClose={handleClosePopup} />}
    </header>
  );
};

export default Header;
